import React, { Component } from 'react';
import {WorkSection,WorkTitle,Span,Part,Icon,PartTitle,Line,PartDesc}  from './style'
import Axios from 'axios';


class Work extends Component {

    state ={
      works : []
    }

    componentDidMount(){
      Axios.get('js/data.json').then( res => {this.setState({works:
      res.data.works}) })
    }

  render(){
    const {works} =this.state;
    const workslist = works.map( (workitem) => {
      return(
        
              <Part first = {workitem.id} key= {workitem.id} >
                  <Icon className={workitem.icon-name}></Icon>
                  <PartTitle>{workitem.title}</PartTitle>
                  <Line/>
                  <PartDesc > {workitem.body} </PartDesc>
              </Part>
      )
    } ) 
    return (
      <WorkSection>
          <div className="container">
          <WorkTitle>
                  <Span>Our</Span> Services
          </WorkTitle>
             
             {workslist}

          </div>
      </WorkSection>
    );
  }
}

export default Work;
